export interface SubsciberDetails {
    /**
     * The name of the Subsciber.
     */
    subscriberName?: string;
    /**
     * The email ID of the subscriber present as per the Member details.
     */
    email?: string;
    /**
     * Indicates any phone number of the subsciber as per Member Details apart from mobile number.
     */
    phoneNumber?: string;
    /**
     * Indicates the mobile phone number of the subsciber as per member details.
     */
    mobileNumber?: string;
    /**
     * The address of the subsciber as per Member Details.
     */
    profileAddress?: string;
    /**
     * The City as per the address of the subsciber.
     */
    profileCity?: string;
    /**
     * The State as per the address of the subsciber.
     */
    profileState?: string;
    /**
     * The Zipcode / Postal code of the subscriber as per the subsciber's address..
     */
    profilePostalCode?: string;
    /**
     * The country name as per the Address of the subsciber.
     */
    profileCountry?: string;
}
